import { useEffect, useState } from "react"
import {
    QueryClient,
    QueryClientProvider,
    useQuery,
  } from "@tanstack/react-query";
import { Outlet } from "react-router-dom";
import { useSearchParams,
            Link } from "react-router-dom";


const IP = '10.10.195.44'
const conf = ['reports', 'config']
async function getTypyLinek (IP) {
    let response = await fetch(`http://${IP}:3005/getTypyLinek`);
    return response.json();
  }

const queryClient = new QueryClient();

export default function Admin() {
  return (
    <QueryClientProvider client={queryClient}>
      <Administrator />
    </QueryClientProvider>
  );
}




function Administrator() {
    let [searchParams, setSearchParams] = useSearchParams();
    const [typOfMainDiv, setTypOfMainDiv] = useState(Null);
    const {isLoading, data} = useQuery({queryKey: ['typyLinek'], queryFn: async () => await getTypyLinek(IP), initialData: []}); 






    const handleBtnConfig = conf => {
        setSearchParams({ conf });
      };



if (isLoading) {
    return <span>Loading...</span>
    }
return (
<div className="flex flex-col items-center w-full">
            <div className="bg-gradient-to-r from-gray-700 to-gray-500 pt-16 pb-16 pl-8 pr-8 text-3xl w-screen text-center text-white ">
                <a>Admin Page</a>              
            </div>
            <div className="flex flex-row h-screen w-screen  ">
                <div className="bg-white w-1/12 border-r-2">
                    <div className="flex flex-col items-center">
                        {data.map((linka) => {
                            return <Link className={`pt-2 pb-2 pl-4 pr-4 bg-slate-200 hover:bg-slate-400 w-fit rounded-full mt-5 ${ 1 === 1 ? "bg-blue-500 text-white" : "" }`}
                            key={linka.PLine_id}  
                            id={linka.PLine_id} 
                            to={`/admin//${linka.PLine_id}`}
                                disabled={isLoading}
                                > {linka.PLine_name}
                            </Link >})}
                            <button className={`pt-2 pb-2 pl-4 pr-4 bg-slate-200 hover:bg-slate-400 w-fit rounded-full mt-5`} 
                                id='newLine' 
                                >
                                Add new line
                              </button>
                    </div>
                </div>
                <div className="bg-white w-1/12 border-r-2">
                    <div className="flex flex-col items-center">
                        {conf.map((conf) => {
                            return <button  className={`pt-2 pb-2 pl-4 pr-4 bg-slate-200 hover:bg-slate-400 w-fit rounded-full mt-5
                            ${ 1===1 ? "bg-blue-500 text-white" : "" }`} id={conf} key={conf} 
                            to={`/admin/${conf}`}
                            disabled={isLoading}
                            > {conf}
                            </button>}
                        )}
                    </div>
                </div>
            </div>
</div>
)};
